import * as React from "react";
const FloatingRing = () => {
      const [ringBeat, setRingBeat] = React.useState(0);
      const [movementPosition,setMovementPosition] = React.useState();
      
      React.useEffect(() => {
        let value = 0;
        let movementValue = 146.46246337890625;
        let directionTop = true;
        let animationFrameId;
    
        const animate = () => {
          value += 0.008; 
          if(directionTop){
              movementValue += 0.5;
          }
          else{
            movementValue -= 0.5;
          }
          if (value > 1) {
            value = 0;
          }
          if(Math.round(movementValue)>180){
            directionTop = false;
          }
          if(Math.round(movementValue)<146){
            directionTop = true;
          }
          setRingBeat(value);
          let movement = `matrix(1.2200000286102295,0,0,1.2200000286102295,-73.40000915527344,-${movementValue})`
          setMovementPosition(movement)
          animationFrameId = requestAnimationFrame(animate);
        };
        animate();
        return () => {
          cancelAnimationFrame(animationFrameId);
        };
      }, []);
  return <svg
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    viewBox="0 0 512 367"
    width={512}
    height={367}
    preserveAspectRatio="xMidYMid meet"
    style={{
      width: "100%",
      height: "100%",
      transform: "translate3d(0px, 0px, 0px)",
      contentVisibility: "visible",
    }}
  >
    <defs>
      <clipPath id="__lottie_element_1832">
        <rect width={512} height={367} x={0} y={0} />
      </clipPath>
      <image xlinkHref="data:image/png;base64," />
      <image xlinkHref="data:image/png;base64," />
      <image xlinkHref="data:image/png;base64," />
    </defs>
    <g clipPath="url(#__lottie_element_1832)">
      <g
        className="png"
        transform="matrix(1.2200000286102295,0,0,1.2200000286102295,-73.40000915527344,-213.90000915527344)"
        opacity={1}
        style={{
          display: "block",
        }}
      >
        <image
          width="540px"
          height="540px"
          preserveAspectRatio="xMidYMid slice"
          xlinkHref="data:image/png;base64,"
        />
      </g>
      <g
        className="png"
        transform="matrix(1.2200000286102295,0,0,1.2200000286102295,-73.40000915527344,-213.90000915527344)"
        opacity={ringBeat}
        style={{
          display: "block",
        }}
      >
        <image
          width="540px"
          height="540px"
          preserveAspectRatio="xMidYMid slice"
          xlinkHref="data:image/png;base64,"
        />
      </g>
      <g
        className="png"
        transform={movementPosition}
        opacity={1}
        style={{
          display: "block",
        }}
      >
        <image
          width="540px"
          height="540px"
          preserveAspectRatio="xMidYMid slice"
          xlinkHref="data:image/png;base64,"
        />
      </g>
    </g>
  </svg>
};
export default FloatingRing;
